create table Course
(
    Id          int identity
        constraint PK_Course
            primary key,
    CourseCode  nvarchar(max) default N'zUybyx',
    CourseName  nvarchar(255) collate SQL_Latin1_General_CP1_CI_AI,
    Description nvarchar(255),
    Duration    nvarchar(max)                                        not null,
    Fee         float         default 0.0000000000000000e+000        not null,
    Discount    float         default 0.0000000000000000e+000        not null,
    IsActive    bit           default CONVERT([bit], 1)              not null,
    CreatedDate datetime2     default '2024-10-09T08:13:31.4186380Z' not null,
    UpdatedDate datetime2     default '2024-10-09T08:13:31.4186790Z' not null,
    LevelId     int                                                  not null
        constraint FK_Course_Level_LevelId
            references Level
            on delete cascade
)
go

create index IX_Course_LevelId
    on Course (LevelId)
go

